configure:
  commands:
    delay-protection: "delay-protection\r\n"
    end:
      new_state: execute
    interface GigabitEthernet1/0/10: "\r\n"
    line console:
      new_state: configure_line
    line console 0:
      new_state: configure_line
    macsec-cipher-suite gcm-aes-256: "macsec-cipher-suite gcm-aes-256\r\n"
    mka policy policy4: "% If cipher currently being used is not configured, new SAK\
      \ will be generated\r\n"
    no logging console: ''
  prompt: LG-PK(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
    line vty: ''
    terminal width 511: ''
  prompt: LG-PK(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
    term width 511: ''
    terminal session-timeout 0: ''
  prompt: LG-PK#
